import styled from "styled-components";

export const ButtonPrimary = styled.button`
  border: none;
  background-color: hsla(319, 100%, 57%, 1);
  color: white;
  border-radius: 30px;
  padding: 10px 20px;
  line-height: 18px;
`;

export const ButtonSecondary = styled.button`
  border: 1px solid grey;
  color: grey;
  border-radius: 30px;
  padding: 10px 20px;
`;
